import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import { AboutPage, CartPage, HomePage, ProductsPage } from "../../Pages";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <HomePage></HomePage>
        </Route>

        <Route path="/about">
          <AboutPage></AboutPage>
        </Route>

        <Route path="/cart">
          <CartPage></CartPage>
        </Route>

        <Route path="/products">
          <ProductsPage></ProductsPage>
        </Route>

        <Route path="/products">
          <ProductsPage></ProductsPage>
        </Route>

        <Route path="/products">
          <ProductsPage></ProductsPage>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
